class Solution:
    def maxOperations(self, s: str) -> int:
        ans = 0
        m = 0
        l = False
        n = []

        for character in s:
            if character == '1':
                n.append(1)
                l = True
            if character == '0' and l:
                n.append(0)
                l = False

        for it in n:
            if it == 1:
                m += 1
            else:
                ans += m

        return ans
